{
  "openapi": "3.0.1",
  "info": {
    "title": "Captcha Destroy API",
    "version": "v1"
  },
  "paths": {
    "/api/Captcha/{secretKey}": {
      "get": {
        "tags": [
          "Captcha"
        ],
        "summary": "Get captcha",
        "description": "Gets information about the captcha added earlier. If it is solved the answer includes the solution string.",
        "operationId": "GetCaptcha",
        "parameters": [
          {
            "name": "secretKey",
            "in": "path",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "captchaId",
            "in": "query",
            "schema": {
              "type": "integer",
              "format": "int32"
            }
          }
        ],
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "text/plain": {
                "schema": {
                  "$ref": "#/components/schemas/CaptchaDTO"
                }
              },
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/CaptchaDTO"
                }
              },
              "text/json": {
                "schema": {
                  "$ref": "#/components/schemas/CaptchaDTO"
                }
              }
            }
          }
        }
      },
      "post": {
        "tags": [
          "Captcha"
        ],
        "summary": "Adds a new captcha to queue",
        "description": "Adds a new captcha to the solution queue if you have enough funds in your account. Use your private key for authentication.",
        "operationId": "AddCaptcha",
        "parameters": [
          {
            "name": "secretKey",
            "in": "path",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "isWait",
            "in": "query",
            "schema": {
              "type": "boolean",
              "default": false
            }
          }
        ],
        "requestBody": {
          "content": {
            "application/json-patch+json": {
              "schema": {
                "$ref": "#/components/schemas/CreateCaptchaDTO"
              }
            },
            "application/json": {
              "schema": {
                "$ref": "#/components/schemas/CreateCaptchaDTO"
              }
            },
            "text/json": {
              "schema": {
                "$ref": "#/components/schemas/CreateCaptchaDTO"
              }
            },
            "application/*+json": {
              "schema": {
                "$ref": "#/components/schemas/CreateCaptchaDTO"
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "text/plain": {
                "schema": {
                  "$ref": "#/components/schemas/CaptchaDTO"
                }
              },
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/CaptchaDTO"
                }
              },
              "text/json": {
                "schema": {
                  "$ref": "#/components/schemas/CaptchaDTO"
                }
              }
            }
          }
        }
      }
    },
    "/info": {
      "get": {
        "tags": [
          "Meta"
        ],
        "summary": "A sample API Controller.",
        "description": "Get meta info",
        "operationId": "GetInfo",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "text/plain": {
                "schema": {
                  "type": "string"
                }
              },
              "application/json": {
                "schema": {
                  "type": "string"
                }
              },
              "text/json": {
                "schema": {
                  "type": "string"
                }
              }
            }
          }
        }
      }
    }
  },
  "components": {
    "schemas": {
      "CaptchaDTO": {
        "type": "object",
        "properties": {
          "captchaUri": {
            "type": "string",
            "format": "uri",
            "nullable": true
          },
          "id": {
            "type": "integer",
            "format": "int32"
          },
          "isSolved": {
            "type": "boolean"
          },
          "solutionString": {
            "type": "string",
            "nullable": true
          }
        },
        "additionalProperties": false
      },
      "CreateCaptchaDTO": {
        "type": "object",
        "properties": {
          "captchaUri": {
            "type": "string",
            "format": "uri",
            "nullable": true
          }
        },
        "additionalProperties": false
      }
    }
  }
}
